<template lang="html">
    <div class="star-count">
        <div @click="likeMais($event)" v-bind:class="{'bounceIn': animate}" class="star-like animated"></div>
        <span>{{postlike}}</span>
    </div>
</template>
<script>
var VueResource = require('vue-resource');
Vue.use(VueResource);

export default {
    data() {
        return {
            animate: false
        };
    },
    props: ['postid','postlike'],
    computed: {},
    ready() {
        var self = this;
        if(!localStorage.getItem('lastLike')) {
            localStorage.setItem('lastLike', 0);
        }
        // localStorage.setItem('lastLike', Date.now());


        // self.$http.get('https://api.ipify.org?format=json').then((response) => {
        //     console.log(response.body.ip);
        // }, (response) => {
        //     console.log('deu ruim');
        // });
    },
    attached() {},
    methods: {
        likeMais: function(id) {
            var self = this;
            // console.log(localStorage.getItem('lastLike'));

            if(localStorage.getItem('lastLike')) {
                var lastLike = localStorage.getItem('lastLike');
                var res = Date.now() - lastLike;
                if(res < 60000) {
                    alert("Tente novamente em 1 min.");
                } else {
                    // alert("Voce votou!");
                    self.animate = true;
                    window.setTimeout(function() {
                        self.animate = false;
                    }, 500);
                    self.postlike = parseInt(self.postlike) + 1;
                    localStorage.setItem('lastLike', Date.now());
                }
                console.log(new Date());
                console.log(res);
                // 5 * 60 * 1000 = 5 min.
                // localStorage.setItem('lastLike', Date.now());
            }
        }
    },
    components: {}
};
</script>
